package com.gj.gejigeji.config;

import com.gj.gejigeji.model.*;
import com.gj.gejigeji.repository.*;
import com.gj.gejigeji.util.ConstUtil;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.CommandLineRunner;
import org.springframework.context.annotation.Lazy;
import org.springframework.stereotype.Component;

import java.util.Date;
import java.util.List;

@Component
@Lazy(false)
public class DbConfig implements CommandLineRunner {

    @Autowired
    FeedRepository feedRepository;

    @Autowired
    PropRepository propRepository;

    @Autowired
    ThemeRepository themeRepository;

    @Autowired
    HenhouseRepository henhouseRepository;

    @Autowired
    ChickenRepository chickenRepository;

    String feedBase64="data:image/jpeg;base64,";

    String themeBase64 = "data:image/jpeg;base64,";

    String propBase64 = "data:image/jpeg;base64,";
    @Override
    public void run(String... args) throws Exception {
        System.out.println("========");

        //
        List<Feed> allFeed = feedRepository.findAll();
        if (allFeed.size()==0) {
            Feed feed1 = new Feed(null,feedBase64,"","","",10f,1);
            Feed feed2 = new Feed(null,feedBase64,"","","",10f,1);
            Feed feed3 = new Feed(null,feedBase64,"1","1","",10f,1);
            Feed feed4 = new Feed(null,feedBase64,"2","2","",10f,1);
            Feed feed5 = new Feed(null,feedBase64,"3","3","",10f,1);
            Feed feed6 = new Feed(null,feedBase64,"4","4","",10f,1);
            feedRepository.save(feed1);
            feedRepository.save(feed2);
            feedRepository.save(feed3);
            feedRepository.save(feed4);
            feedRepository.save(feed5);
            feedRepository.save(feed6);
        }

        // 
        if (themeRepository.findAll().size() == 0) {

            for (int i = 0; i < 3; i++) {
                Theme theme = new Theme(null,themeBase64,""+i,"",10f*i);
                Theme save = themeRepository.save(theme);

                for (int j = 0; j < 6; j++) {
                    Prop prop = new Prop(null,save.getId(),propBase64,"1","1desc",10f,1);
                    propRepository.save(prop);
                }

            }

        }

        //
        if (chickenRepository.findAll().size() == 0) {
            Chicken chicken = new Chicken();
            chicken.setName("");
            chicken.setCreateTime(new Date());
            chicken.setUpdateTime(new Date());
            chicken.setDeleteFlag(ConstUtil.Delete_Flag_No);
            chicken.setMaxEgg(2);
            chickenRepository.save(chicken);

        }

        //
        if (henhouseRepository.findAll().size() == 0){
            Henhouse henhouse = new Henhouse();
            henhouse.setName("");
            henhouse.setDesc("desc");
            henhouse.setPrice(100f);
            henhouse.setUrl("www.jishe.com");
            henhouseRepository.save(henhouse);
        }



        System.out.println("===================");
    }
}
